const greenTheme = {
	colors: {
		background: '#505050',
		opposite: '#ffffff',

		Primary: '#6E8F6D',
		Secondary: '#9CC69B',
		Tertiary: '#B9E8A0',
		Quaternary: '#D7F2BA',
		Quinary: '#F5FEEC',
	},
};

export default greenTheme;
